import React from "react";
import './Popup.css';

const Popup = props => {
  return (
    <div className="popup-box">
      <div className="box_text_popup">
        <span className="close-icon" onClick={props.handleClose}>x</span>
        {props.content}
      </div>
    </div>
  );
};
 
export default Popup;
